import React from "react";
import { PowerBIEmbed } from "powerbi-client-react";
import { models } from "powerbi-client";

const PowerBI = () => {
  return (
    <div
      style={{
        height: "800px",
      }}
    >
      <PowerBIEmbed
        embedConfig={{
          type: "report",
          id: "a7ab29a3-02c7-4c45-81a8-e756e9897d79",
          embedUrl:
            "https://app.powerbi.com/reportEmbed?reportId=af1e3172-bec8-4ce4-98f3-bee955673a41&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLUlORElBLUNFTlRSQUwtQS1QUklNQVJZLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJ1c2FnZU1ldHJpY3NWTmV4dCI6dHJ1ZX19",
          accessToken:
            "eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Ii1LSTNROW5OUjdiUm9meG1lWm9YcWJIWkdldyIsImtpZCI6Ii1LSTNROW5OUjdiUm9meG1lWm9YcWJIWkdldyJ9..El01bKQnsy9PhehBUBXji7M3ZvKwY52WeCaqnozIOsfT5fC81FKo4n_2Yw14z_d3cuwbtvptEzmTdHJLZlILJL4exU_gvJHUMrF8Rgv2xIM-7zQd1NLz053L-0TkYX2d6pUbsLq4gXyRBa2nFDsRLRZ0FT40FqIflbqj7LNUrSilpwSUsK6CM3Shz9EXOj1PhjoQXBH4q2UhYf_bGEQkQs4hGltv-6vQX9cUIzShcIS0WxuNYqh4XD78U_xaY0bB4K39-mEvgTcWgc6HXAv8MkwRDGzuCrexhy822PRU0HbX36qHMbEkp7RE649LF5BG5HbORMtJaGJ2sZHxlWBQnw",

          tokenType: models.TokenType.Aad,
          settings: {
            panes: {
              filters: {
                expanded: false,
                visible: false,
              },
            },
            background: models.BackgroundType.Transparent,
          },
        }}
        eventHandlers={
          new Map([
            [
              "loaded",
              function () {
                console.log("Report Loaded");
              },
            ],
            [
              "rendered",
              function () {
                console.log("Report Loaded");
              },
            ],
            [
              "error",
              function (event) {
                console.log(event.detail);
              },
            ],
          ])
        }
        // cssClassName={"report-style-class"}
        getEmbeddedComponent={(embeddedReport) => {
          window.report = embeddedReport;
        }}
      ></PowerBIEmbed>
    </div>
  );
};

export default PowerBI;
